    <h3>טינדר הגרסה הלא מצונזרת - הפרטים שבאמת מעניינים</h3>

    <main>
        <form action="http://html5-book.co.il/teach/forms/get_form2.php" method="GET">


            <label id="name"> שם מלא
                <input  name="fullName" required type="text" pattern="[a-zA-Z\s]+[ ][a-zA-Z\s]+"  title="full Name">
            </label>
            <br>

            <label id="pass"> טלפון (אין צורך לשקר זה חסוי)
                <input name="pass" type="password" >
            </label>

            <br>
            <label id="gender"> מגדר
                <br>
                <input  name="gender" type="radio" value="male"> גבר גבר
                <br>
                <input name="gender" type="radio" value="female"> נסיכה
                <br>
                <input name="gender" type="radio" value="other"> אחר
            </label>


            <br>
            <label id="age">גיל
                <select name="age" required="">
                    <option value="" disabled="disabled" selected="selected">בחר</option>
                    <option value="20">20</option>
                    <option value="21">22</option>
                    <option value="22">22</option>
                    <option value="23">23</option>
                    <option value="24">24</option>
                    <option value="25">25</option>
                    <option value="26">26</option>
                    <option value="27">27</option>
                    <option value="28">28</option>
                    <option value="29">29</option>
                    <option value="30">30</option>
                </select>
            </label>

            <br>
            <label>אינסטוש/פייסבוק (לפני שמתחילים לדבר)
                <input name="website" type="url">
            </label>

            <br>
            <label id="Relationship"> מערכת יחסים
                <br>
                <input  name="gender" type="radio" value="male"> אין סטנדרטים...יש דופק?
                <br>
                <input name="gender" type="radio" value="female"> מישהו/י שיאכל לי את הראש
                <br>
                <input name="gender" type="radio" value="other"> חופה וקידושין
            </label>

            <br>
            <label id="mail">ימני/שמאלני (אבל בלי חפירות סבבה?)
                <input autocomplete name="mail" type="email">
            </label>

            <br>
            <label id="phone"> מהי הכנסתך החודשית
                <input name="phone" type="tel" pattern=".{9,}[0-9]"  maxlength="10" title="number between 0-9">
            </label>

            <br>
            <label id="coffee">מה הגובה (המצוי ולא הרצוי)
                <input name="coffee" type="number">
            </label>

            <br>
            <label id=>האם קיים אצלך תסביך אמא/אבא
                <input name="temper" type="temper">
            </label>

            <br>
            <label id="temper"> עד כמה חשוב לך מראה חיצוני
                <br>
                <br>
                מאוד חשוב<input max="100 " min="50 " name="temper" type="range">הכי חשוב
            </label>
            </label>

            <br>
            <label>
                <input name="interests[]" type="checkbox" value="GYM">
                מעשן/ת (וכן פעם בשבוע זה גם נחשב)
            </label>

            <br>
            <label> מקום עבודה (תזכור אחמש זה לא מנהל)
                <input name="Address" type="adress">
            </label>

            <br>
            <label> גודל דירה (החדר אצל ההורים לא נחשב)
                <input name="Address" type="adress">
            </label>

            <br>
            <label> תחביבים
                <br>
                <label>
                    <input name="interests[]" type="checkbox" value="GYM">
                    חדר כושר (פעמיים בחודש זה לא נחשב תחביב)
                </label>
                <br>
                <label>
                    <input name="interests[]" type="checkbox" value="Play RedAlert">
                    קריאת ספרים (על מי אתם עובדים ברור שנטפליקס)
                </label>
                <br>
                <label>
                    <input name="interests[]" type="checkbox" value="Coding-tutorials">
                    לטייל בטבע (שדרות רוטשילד לא נחשב טבע)
                </label>
                <br>
                <label>
                    <input name="interests[]" type="checkbox" value="Coding-tutorials">
                    לשמוע מוזיקה זה לא תחביב
                </label>
                <br>

                <br>
                <label>ספר/י על עצמך בכמה מילים
                    <textarea cols="30" name="כמה מילים" rows="5">מוגבל לתו אחד</textarea>

                    <br>
                    <br>
                    <input type="submit" onclick="return Valid()"  value="submit">

        </form>
    </main>

    <script>
        function checkBoxes()
        {
            var box = document.getElementsByTagName('input');
            for (var i = 0; i < box.length; i++)
            {
                if (box[i].type == 'checkbox')
                    if (box[i].checked) 
                        return true;
            }
            return false;
        }
        function Valid()
        {
            if(!checkBoxes())
            {
                alert("Choose a hobby");  
                return false;
            }
            return true;
        }
    </script>
